import React from 'react';
import { HomeContainer, TitleName,TitleContainer, BioContainer, Bio } from './styles';

const Home = ()=> {
    return(
        <HomeContainer>
            <TitleContainer>
              <TitleName>KLIHSMAN</TitleName>
              <BioContainer>
                  <Bio>Olá, me chamo Klihsman Freitas, sou um full-stack developer, com foco em desenvolvimento front-end na stack JS (Node, React e React-native). Tenho experiência em desenvolvimento de sites e aplicativos em geral. Além disso, sou formando em Análise e Desenvolvimento de sistemas pelo Instituto Federal da Paraíba (IFPB).</Bio>
              </BioContainer>
            </TitleContainer>
        </HomeContainer>
    )
}

export default Home;
